    const { data } = useSelector((state) => state.data); 
    console.log(data)
    
  return (
    <div>
      {data.map((imgs, index) => (
        <div key={index}>
          <img src={imgs.img.props.src} alt={imgs.img.props.alt} />
        </div>
      ))}
    </div>
  )
}

export default Game
